import React, { useState }  from 'react';


const PedidoListRow = ({pedido}) => {

  const [exibirPedido, setExibirPedido] = useState(false)

  return(
    <tr>
      <td>{pedido.id}</td>
      <td>{pedido.nome}</td>
      <td>{pedido.descricao}</td>
      <td>{pedido.status}</td>
    </tr>
  );
};

export default PedidoListRow;
